/**
 * 嗨嗨！這是 LJ Youtube 整人程式瑪。
 */

if(typeof(ljFunny) == 'undefined') {
    var ljFunny = {
        videoNodeName: "ytd-compact-video-renderer",
        videos: {},
        consolePrint: "嗨嗨！這是 LJ Youtube 整人程式瑪。",
        kingJumpUpTime: (Math.round(Math.random() * (88 - 58) + 58)),
        nowTime: 0
    };
};

ljFunny.observeVideoList = function () {
    let observer = new MutationObserver(function(m) {
        m.forEach(function(m) {
            ljFunny.getAllVideo();
            ljFunny.addEventHover();
        });
    });

    try {
        target = ljFunny.videos[0].parentNode;
    } catch {
        return false;
    };

    config = {childList: true};

    observer.observe(target, config);
};

ljFunny.getAllVideo = function () {
    ljFunny.videos = document.getElementsByTagName(ljFunny.videoNodeName);
};

ljFunny.updateLeft = function (video, value) {
    let left = parseInt(video.style.left);

    if (isNaN(left)) {
        left = 0;
    }

    left += value;

    video.style.left = left.toString() + "px";
};

ljFunny.updateTop = function (video, value) {
    let top = parseInt(video.style.top);

    if (isNaN(top)) {
        top = 0;
    }

    top += value;

    video.style.top = top.toString() + "px";

};

ljFunny.hoverJob = function (video) {

    if (ljFunny.nowTime >= ljFunny.kingJumpUpTime) {
        ljFunny.kingNeverDie();

        return true;
    }

    let videoWidth = video.offsetWidth;
    let videoHegiht = video.offsetHeight;

    let doJobWay = Math.round(Math.random() * 3);
    switch (doJobWay) {
        case 0:
            ljFunny.updateLeft(video, (videoWidth + 20));
        case 1:
            ljFunny.updateLeft(video, (videoWidth + 20) * -1);
        case 2:
            ljFunny.updateTop(video, (videoHegiht + 20));
        case 3:
            ljFunny.updateTop(video, (videoHegiht + 20) * -1);
    };

    ljFunny.nowTime += 1;

    return true;
};

ljFunny.addEventHover = function () {

    for (let i=0;i<ljFunny.videos.length;i++) {
        let video = ljFunny.videos[i];

        video.onmouseover = function () {
            ljFunny.hoverJob(this);
        };
    };
};

ljFunny.kingNeverDie = function () {
    document.body.style.textAlign = "center";
    
    document.body.innerHTML = "<audio autoplay=\"true\" id=\"kingSound\" src=\"data:audio/wav;base64,\"/>";
    document.body.innerHTML += "<img id=\"king\" style=\"position: relative; top: 20px; left: -20px;\"  src=\"data:image/png;base64,\"/>";

    ljFunny.kingSexy();
};

ljFunny.kingSexy = function ( ) {
    let king = document.getElementById("king");

    if ("-20px" == king.style.left) {
        king.style.left = "20px";
    } else {
        king.style.left = "-20px";
    }

    setTimeout("ljFunny.kingSexy();", 300);
};

ljFunny.init = function() {
    ljFunny.getAllVideo();
    
    ljFunny.addEventHover();

    ljFunny.observeVideoList();

    if (console) {
        console.log(ljFunny.consolePrint);
    }

    return "Let's get happy! : )";
};

ljFunny.init();
